//SPDX-License-Identifier: BUSL-1.1
pragma solidity ^0.8.0;

import {Address} from "@openzeppelin/contracts/utils/Address.sol";

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/Pausable.sol";


//Pausable.sol - https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/security/Pausable.sol
//Address.sol - https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/utils/Address.sol

contract SEGA is Pausable {

    address payable private parentVault;
    address private trader;

    string constant noAccess = "User not Authorized";
    string constant txnFail = "Transaction Failed";

    //Events

    event Received(address indexed _from, uint amount);

    event SentOutAssets(address indexed _to, address indexed _token, uint256 _amount);
    event ApprovedTokensOut(address indexed _to, address indexed _token, uint256 _amount);

    event SmartContractCall(address indexed _SC, bytes4 indexed _method, uint256 _value);
    event SegaTraderChanged(address newTrader);

    /*********************************************
    Modifiers
    *********************************************/

   modifier isParentVault() {
        _isParentVault();
        _;
    }    

    modifier isTrader() {
        _isTrader();
        _;
    } 

    modifier isVaultOrTrader() {
        _isVaultOrTrader();
        _;
    }

    function _isParentVault() internal view {
        require(msg.sender == parentVault, noAccess);
    }    

    function _isTrader() whenNotPaused internal view {
        require(msg.sender == trader, noAccess);
    } 

    function _isVaultOrTrader() internal view {
        require( msg.sender == parentVault ||
                (!paused() && msg.sender == trader),
         noAccess
        );
    }

    function _notZero(address _address) internal pure {
        require (_address != address(0), "Zero Address Not Allowed");
    }

    function _enoughBalance(IERC20 _token, uint256 _amount) internal view {
        require(_token.balanceOf(address(this)) >= _amount, "Insufficient balance");
    }

    /*******************************************
     Constructor, Recieve, Fallback
     *******************************************/

    constructor(address _parentVault, address _owner) {
        parentVault = payable(_parentVault);
        trader = _owner;
    }

    receive() external payable {
        emit Received(msg.sender, msg.value);
    }

    fallback() external payable {
        if (msg.value > 0) {
            emit Received(msg.sender, msg.value);
        }
    }

    /*------------------------------------------
    Functions called by ParentVault - Owner/ROs
    ------------------------------------------*/

    /***************************
    Vault Issued Admin Functions
    ***************************/

    //-----To Pause & Unpause Account Transfers-----//

    function pauseTransfers() external isParentVault {
        _pause();
    }
    function unpauseTransfers() external isParentVault {
        _unpause();
    }

    //-----To Change Prime Trader & AMs-----//

    function changeTrader (address _newTrader) external isParentVault {
        trader = _newTrader;
        emit SegaTraderChanged(_newTrader);
    }

    /*--------------------------------------------
    Return of Account Balances to Parent Vault
    ----------------------------------------------*/

    // to withdraw ETH back to Parent Vault
    function returnToVault(uint256 _amount) public isVaultOrTrader {
        Address.sendValue(parentVault, _amount);
        emit SentOutAssets(parentVault, address(0), _amount);
    }

    // to withdraw Tokens back to Parent Vault
    function returnToVault(address _token, uint256 _amount) public isVaultOrTrader {
        _notZero(_token);
        IERC20 Token = IERC20(_token);
        _enoughBalance(Token, _amount);
        bool success = Token.transfer(parentVault,_amount);
        require(success, txnFail);
        emit SentOutAssets(parentVault, _token, _amount);
    }


    /*------------------------------------------
     Trader Execution Functions
     ------------------------------------------*/

    /*********************************************
    Simple Transfer of ETH && Transfer-Approve of ERC20
    *********************************************/

    //Transfering Eth to allowed counterparties
    function sendAssets(address payable receiver, uint256 amount) public isTrader {
        _notZero(receiver);
        Address.sendValue(receiver, amount);
        emit SentOutAssets(receiver, address(0), amount);
    }

    // Transferring & Approving allowed Tokens to allowed Counterparties

    function sendAssets(address receiver, address _token, uint256 amount) public isTrader {
        _notZero(_token);
        _notZero(receiver);
        IERC20 Token = IERC20(_token);
        _enoughBalance(Token, amount);
        bool success = Token.transfer(receiver, amount);
        require(success, txnFail);
        emit SentOutAssets(receiver, _token, amount);
    }

    function tokenApprove(address spender, address _token, uint256 amount) public isTrader {
        _notZero(_token);
        _notZero(spender);
        IERC20 Token = IERC20(_token);
        bool success = Token.approve(spender, amount);
        require(success, txnFail);
        emit ApprovedTokensOut(spender, _token, amount);
    }

    /*********************************************
    Smart Contract Interactions by trader
    *********************************************/

    function callSC(address smartContract, bytes memory data) public isTrader {
        Address.functionCallWithValue(smartContract, data, 0, txnFail);
        bytes4 method = getMethod(data);
        emit SmartContractCall(smartContract, method, 0);
    }

    function callSC(address smartContract, bytes memory data, uint256 _value) public isTrader {
        Address.functionCallWithValue(smartContract, data, _value, txnFail);
        bytes4 method = getMethod(data);
        emit SmartContractCall(smartContract, method, _value);
    }

    /*********************************************
    Internal Utilities
    *********************************************/

    function getMethod(bytes memory _data) internal pure returns (bytes4 M) {
        assembly {
            let a := add(_data,32)
            M := mload(a)
        }
    }

    function getInfo() public view returns (address, address, bool) {
        return (parentVault, trader, !(paused()));
    }


}
